using AwesomePlaces.Core.Entities;
using AwesomePlaces.Core.Enums;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Hosting;
using Microsoft.Extensions.Logging;

namespace AwesomePlaces.Infrastructure.Persistance;
public static class PlaceEfSeedContext
{
    public static async Task<IHost> PlaceEfSeed(this IHost host)
    {
        using IServiceScope scope = host.Services.CreateScope();

        ILoggerFactory loggerFactory = scope.ServiceProvider.GetRequiredService<ILoggerFactory>();
        var logger = loggerFactory.CreateLogger("PlaceDbSeeder");

        PlaceEfContext placeEfContext = scope.ServiceProvider.GetRequiredService<PlaceEfContext>();

        if (!placeEfContext.Places.Any())
        {
            await placeEfContext.AddRangeAsync(SeedPlaces());
            await placeEfContext.SaveChangesAsync();
        }
        return host;
    }

    private static List<Place> SeedPlaces()
    {
        return new List<Place>
        {
            new Place(Guid.NewGuid(), "Jezioro Mucharskie", "Jezioro Mucharskie jest to zaporowy zbiornik retencyjny na Skawie. Zbiornik znajduje się na terenach gmin Mucharz, Stryszów i Zembrzyce. Zapora usytuowana jest na 26,6 km biegu Skawy, powierzchnia zlewni rzeki do zapory wynosi 802 km².", PlaceTypes.Lake, new Coordinate(49.82246483544849, 19.549658499360334), new Address(Guid.NewGuid(), "Mucharz", "Mucharz", "małopolskie", "34-106", "Polska"), Convert.FromBase64String(""), 4.3, false),
            new Place(Guid.NewGuid(), "Galapagos", "Galapagos, także Wyspy Żółwie czyli archipelag pochodzenia wulkanicznego na Oceanie Spokojnym, na wysokości równika, ok. 1000 km na zachód od wybrzeża Ameryki Południowej. Wyspy należą do Ekwadoru, a ich powierzchnia wynosi ok. 8 tys. km².", PlaceTypes.Island, new Coordinate(-0.6144557552240193, -90.34515655781594), new Address(Guid.NewGuid(), "Galapagos", "Galapagos", "Galapagos", "25124", "Ekwador"), Convert.FromBase64String(""), 4.96, true),
