            new Place(Guid.NewGuid(), "Woliński Park Narodowy", "Woliński Park Narodowy utworzony w 1960 roku obejmuje ochroną część największej polskiej wyspy — Wolin (woj. zachodniopomorskie). Szczególne walory parku to: najpiękniejszy odcinek polskiego wybrzeża klifowego, dobrze zachowane lasy bukowe, unikalna — wyspiarska delta Świny, przybrzeżny pas wód Bałtyku.", PlaceTypes.NationalPark, new Coordinate(53.897417474335896, 14.486044842285393), new Address(Guid.NewGuid(), "Międzyzdroje", "Międzyzdroje", "zachodniopomorskie", "72-500", "Polska"), Convert.FromBase64String(""), 4.87, false),
            new Place(Guid.NewGuid(), "Petra", "Petra, stolica królestwa Nabatejczyków i prężny ośrodek handlowy aktywny od 400 r. p.n.e. do 106 n.e., z powodu kolorowego piaskowca, w którym wykuto jej budowle, zwana jest też Różowo-Czerwonym Miastem. Do Petry można dotrzeć wyłączenie jedną wąską drogą. Ruiny starożytnego miasto to jedna z największych atrakcji turystycznych Królestwa Jordanii. ", PlaceTypes.NatureBeauty, new Coordinate(30.328454313539662, 35.444360196254436), new Address(Guid.NewGuid(), "Petra", "Petra", "Uum Sayhoun", "8CHV+9P", "Jordania"), Convert.FromBase64String(""), 4.95, true),
            new Place(Guid.NewGuid(), "Zatoka El Nido", "Bajeczna zatoka El Nido to jedno z najbardziej romantycznych miejsc na naszej planecie. Rosnący tam podwodny las jest atrakcją turystyczną Filipin i każdego roku przyciąga setki tysięcy amatorów nurkowania. To miejsce to prawdziwy kawałek raju: ma lazurowe wody, nieskazitelnie biały piasek i płytkie laguny pełne zachwycających okazów zwierząt morskich.", PlaceTypes.Bay, new Coordinate(11.19531044959591, 119.41123272584483), new Address(Guid.NewGuid(), "El Nido", "El Nido", "Palawan", "63(0)48", "Filipiny"), Convert.FromBase64String(""), 5.00, true),
        };
    }
}
